var tipuesearch = {"pages": [{'title': '簡介', 'text': '組長 :\xa0 李承澤 40723210 \xa0 \n 組員: \n 張詠全 40723125\xa0\xa0 \n 廖豪樹 40723144\xa0 \n 李其叡 40723111\xa0 \n 王頊鑌 40723108\xa0 \n 許鐸鐙40426227\xa0 \n 俆敬倫40723124 \n 分組倉儲: https://mdewcm2019.github.io/wcm2019-task-g2 \n 分組blogger:\xa0 https://wcm2019-task-g2.blogspot.com/ \n 班級倉儲: https://github.com/scrum-1/wcm2019a \n \n', 'tags': '', 'url': '簡介.html'}, {'title': '網路連線設定', 'text': '了解機械設計系電腦輔助設計室電腦的網路設定, 其中包括 IPv4 網路與 IPv6 網路設定. 正常情況下, 電腦輔助設計室中的 64 台電腦透過 IPv4 協定下的 DHCP 與 NAT 上網, 各電腦以 DHCP client 取得 192.168.1.* 的網路位址, 然後以 NAT 的一組外部 IP 上網, 通常必須設定 Proxy Server 為 http://proxy.kmol.info:3128 後上網會比較順暢, 但若 8 台 Proxy Servers 無法正常運作時, 則取消 Proxy Server 的設定. 瀏覽器代理主機設定 了解如何設定 Google Chrome 與 Firefox 瀏覽器的代理主機設定. 申請 Github 帳號 利用 Gmail 帳號申請 Github 帳號, 申請後利用電子郵箱收信進行確認後, 就可以在 Github 上建立倉儲. \n', 'tags': '', 'url': '網路連線設定.html'}, {'title': '1.李承澤 40723210', 'text': '我的blogger文章: https://40723210.blogspot.com/2019/05/github.html \n 操作流程和影片: \n 1.進入網頁之後在按右上角符號裡的設定 \n 2.滾到最下面>按進階>點擊 (開啟proxy設定) \n 3.點選LAN設定>打開proxy>輸入140.130.17.32>3128即可 \n 4.創建github帳戶，帳號是s加上學號，email是用學校給的 \n 我的教學影片: https://youtu.be/T6CIPW9ujT0 \n IPv6 環境設定 操作過程: \n 1.進入控制台開啟網路連線 \n 2.選擇自己所用的網路 > 右鍵內容 \n 3.勾選IPV6並取消IPV4，點選進入IPV6 \n 4.使用DNS輸入 2001:b000:168::1 \n 5.在網頁的proxy中設定完即可 \n 我的教學影片: https://youtu.be/uw8-NoNFpm0', 'tags': '', 'url': '1.李承澤 40723210.html'}, {'title': '配置可攜程式環境', 'text': '取得 Windows 10 64 位元環境下的可攜程式環境 (下載\xa0 2019_cdb_w5.7z), 下載後解開目錄, 放入 USB3.0 規格以上的隨身碟或隨身硬碟. 以滑鼠點擊 start.bat 開啟可攜隨身系統, 以 stop.bat 關閉可攜隨身系統, 隨身碟必須在關閉所有應用程式執行下, 才可正常退出. 了解基本的 DOS (Disk Operating System) 指令 C:\\> 符號為 DOS 命令列視窗的回應 (Prompt), 表示目前在 C 槽硬碟的 \\ 根目錄, 若要切換到 Y 槽, 則在電腦的回應後, 輸入 Y:, 命令列將轉為 Y:\\> 若要更換目錄, 則使用 cd, 也就是 change directory 的意思, 例如: Y:\\>cd tmp 表示要從 Y 槽的根目錄更換到 tmp 目錄, 也就是 Y:\\tmp> 若要再回到 Y 槽的根目錄, 可以使用 cd .. 表示要從目前所在目錄, 往上跳回一個目錄, 也就是重新回到 Y 槽的根目錄. 另外, 無論目前位於哪一個子目錄, 也可以使用 cd \\ 直接回到根目錄. 或者從 Y:\\> 直接使用 cd \\tmp\\repo\\ssh\\wcm2019 直接從 Y 槽的根目錄, 跳進 Y:\\tmp\\repo\\ssh\\wcm2019> 此外, 常用的 DOS 指令有: dir - 列出目前所在目錄的內容 mkdir - 隨後加上要建立目錄的名稱, 可以建立目錄 cls - clear screen, 清除目前的命令列顯示的內容 \n', 'tags': '', 'url': '配置可攜程式環境.html'}, {'title': '2.李承澤 40723210', 'text': '我的blogger文章: https://40723210.blogspot.com/2019/05/blog-post_39.html \n 操作流程和影片: \n 1.進入老師的blogger點選 2019_cdb_w13.7z 連結 \n 2.下載完成以後，解壓縮放進自己的隨身碟 \n 3.點選start.bat來開啟程式 \n 4.輸入d: >\xa0cd tmp >\xa0cd 40723210(你的資料夾) \n 5.進入後就可以進行改動了 \n ★git指令可參照 簡介 內的重點筆記 \n 我的教學影片: https://youtu.be/lt86JkoTHnU \n', 'tags': '', 'url': '2.李承澤 40723210.html'}, {'title': '倉儲改版', 'text': '建立 Git 倉儲, 並 clone 倉儲至近端工作後, 對遠端倉儲改版 可攜程式系統中已經內建 git, 可以在啟動 start.bat 後, 透過 path 的設定, 直接執行 git 指令. 建立 Git 倉儲, 共分為兩類, 一類是直接在 Github 網際介面下建立倉儲時, 要求建立 README.md 檔案, 之後可以直接在近端, 以 git clone 加上倉儲連線 URL, 將倉儲克隆一份到近端, 並以最新版本作為工作目錄, 使用者改版後, 可以直接透過 git add, commit 與 push 對遠端倉儲改版. 另一類則是故意在 Github 網際介面下建立倉儲時, 不要建立任何檔案, 而是在近端自行利用 git 指令建立倉儲架構, 新增內容後, 以 git remote add 設法在近端倉儲中納入 origin URL 後, 將近端倉儲版本新增提交推送到遠端. git add git add 可以用來新增一個檔案, 數個檔案, 或在之前提交後所新增的所有內容. git add 在 GIT 架構下, 是對所新增或修改的內容拍快照: git add . adds all modified and new (untracked) files in the current directory and all subdirectories to the staging area (a.k.a. the index), thus preparing them to be included in the next git commit . Any files matching the patterns in the .gitignore file will be ignored by git add git commit  git commit 執行之前, 必須使用 git config 建立臨時或永久的身分註記, 因為 GIT 在展開所有改版內容時, 必須明確登錄這些變更的作者與時間. 當使用者採用 git commit -m "改版說明訊息", 此次提交到 .git 目錄下的更動內容, 均會綁定使用者身分與改版所輸入的說明訊息. git push git push 在隨後沒有輸入遠端 URL 代號時, 表示要推送到 origin, 若透過 git remote add 設定其他代號與 URL 對應時, git push 加上代號, 就可以將此次的提交內容, 推送到指定的 URL 所在遠端倉儲. \n', 'tags': '', 'url': '倉儲改版.html'}, {'title': '3.李承澤 40723210', 'text': '我的blogger文章: https://40723210.blogspot.com/2019/05/blog-post_21.html \n 操作流程和影片: \n 1.先登入自己的github帳號。 \n 2.創建一個新的倉儲repositories。 \n 3.git clone\xa0 https://github.com/s40723210/40723210 \xa0。 \n 4.進入要存放該資料的資料夾tmp。 \n 5.開啟倉儲設定，點選要推送的branch。 \n 6.進入該倉儲資料夾，開始更新或變動。 \n 7.git status > git add . > git commit -m "標題" > git push。 \n ★git指令可參照簡介內的重點筆記 \n 我的教學影片: https://youtu.be/QBcUQYGy554 \n 我的blogger文章: https://40723210.blogspot.com/2019/04/ssh-keygit-clone-git-push.html \n 使用ssh key來進行git clone 與git push: \n \n 1.先把git config --edit --system裡面的helper = manager刪除後輸入:wq(是指儲存後退出)。 \n 2.進入控制台>使用者帳戶>認證管理員>windows認證>刪除現存的github帳號。 \n 3.輸入ssh-keygen -t rsa -b 4096 -C "github的email"。 \n 4.輸入你想存放的位子例如:Y:\\home\\.ssh/id_rsa。 \n 5.一直案Enter到結束。 \n 6.打開id_rsa並且全部複製>進入setting>SSH and\xa0GPG\xa0keys 。 \n 7.案New ssh key 貼上>輸入想要的名子儲存。 \n 我的教學影片: https://youtu.be/SJHMm3o5uEw \n', 'tags': '', 'url': '3.李承澤 40723210.html'}, {'title': '靜態 CMSimfly', 'text': '利用 CMSimfly (https://github.com/chiamingyen/cmsimfly) 內容, 建立自己的 Github Pages 網站 設法利用  HTML5 CSS 與 Javascript , 納入與機械設計相關的靜態網頁內容 \n', 'tags': '', 'url': '靜態 CMSimfly.html'}, {'title': '4.李承澤 40723210', 'text': '我的blogger文章: https://40723210.blogspot.com/2019/05/cmsimfly.html \n 操作流程和影片: \n 1.進入自己的倉儲資料夾 2.輸入python wsgi.py來開啟動態 3.進行改版或更新save 4.完成後按generate_pages來儲存 5.輸入git status > git add . > git commit -m "標題" > git push 6.到自己的倉儲檢查沒問題後即可 \n ★我納入的 Javascript ，都在分支裡 我的教學影片: https://youtu.be/z8sUoVAqmDo', 'tags': '', 'url': '4.李承澤 40723210.html'}, {'title': 'Mobile 網站內容', 'text': '學習如何使用 CMSimfly, 在網站中加入各種內容 (導入 Bootstrap frontend framework) 使用 Flask, bs4 與 lxml 模組 了解 CMSimfly 如何建構, 並且嘗試修改現有功能, 除錯或建立自己的網際內容管理系統 \n', 'tags': '', 'url': 'Mobile 網站內容.html'}, {'title': '5.李承澤 40723210', 'text': '我的blogger文章: https://40723210.blogspot.com/2019/05/mobile.html \n 操作流程和影片: \n 1.要使用老師模板的話，先進到老師的Github 2.點選系統開發 > Mobile 網站內容 > 套用模板一 3.進到連結後下載zip > 解壓縮 >改名成chimper 4.進到要改的倉儲 >\xa0 將資料夾放入static資料夾內 5.開起一個老師的新模板倉儲 > 以Raw打開cmsimfly.leo 6.複製全部 > 到自己的倉儲cmsimfly.leo > 貼上並儲存 7.以Raw打開老師的flaskapp.py > 一樣步驟貼上並儲存 8.進入動態更改 > 直接按generate_pages儲存即可 我的教學影片: https://youtu.be/DKVSZYUkotI \n', 'tags': '', 'url': '5.李承澤 40723210.html'}, {'title': 'Virtual Host', 'text': 'Fossil SCM 如何利用 Fossil SCM, 在 Virtualbox 中的 Ubuntu 18.04-2 (8.5 GB) 建立類似 Github 的系統, 可以放入 CMSimfly 的靜態網頁 Ubuntu 18.04 (https://www.ubuntu.com/about/release-cycle), 配置網路連線, 然後架構 uwsgi 環境下的 CMSimfly 動態網站, 或建立 Fossil SCM 用來伺服管理 CMSimfly 下有版次管理的靜態網頁, 或利用 nginx 伺服無版次管理的 CMSimfly 靜態網頁. \n \n', 'tags': '', 'url': 'Virtual Host.html'}, {'title': '6.李承澤 40723210', 'text': '我的blogger文章: https://40723210.blogspot.com/2019/05/virtual-host.html \n 操作流程和影片: \n 1.google輸入ubuntu > 點選官網 > 下載 ubuntu server 2.打開virtualbox > New > 輸入名子 > 4096 MB 3.Cearte > VMDK > Dynamically > 500.00 GB 4.Sttings > Network > bridged Adapter > 進入網路中心 5.選擇電腦所使用的連接網路 > ok > Start 6.選取剛剛所下載的ubuntu > 開始 > 選取語言 7.Enter >\xa0 Enter > 輸入proxy :http://140.130.17.3:3128 8. Enter \xa0>\xa0 Enter \xa0>\xa0 Enter \xa0> continue > 全部都打一樣的 9.space >\xa0 Enter \xa0>\xa0 Enter \xa0> 再輸入帳密 > 即可開始設定 10. \xa0輸入 sudo apt install uwsgi 來安裝uwsgi 我的教學影片: https://youtu.be/03R3tUvTyIQ \xa0 \n 開始設定的流程 \n 我的blogger文章: https://40723210.blogspot.com/2019/06/virtual-host-2.html \n 根據老師的教學步驟: 1. 安裝最新版的 Virtualbox 2. 建立 Ubuntu 18.04 虛擬主機 3. 以網路卡橋接啟動 Ubuntu 伺服器 4. 以 sudo apt install nginx 安裝 nginx WWW 伺服器 5. 以 ifconfig 查 Ubuntu 伺服器的 IP, 測試 nginx 伺服器是否可以連線 6. 以 Windows 10\xa0 下的 Filezilla client, 將編輯好的 nginx 設定檔案送到 Ubuntu 7.\xa0利用 Ubuntu 指令將設定檔案搬至設定位置後, 以 /etc/init.d/nginx restart 重新啟動 nginx 8. 在 Ubuntu 中以 sudo apt install uwsgi 安裝 uwsgi 9. 在 Windows 10 編輯 uwsgi 與 nginx 所需的設定檔案, 完成後以 filezilla 送至 Ubuntu. 10. 將 CMSimfly 程式碼送到 Ubuntu 伺服器中對應目錄後. 11. 在 Ubuntu 建立 cmsimfly 服務, 並設定隨機啟動. 12. 完成後, 在 Windows 10 以瀏覽器連線至 CMSimfly, 確認動態網頁與靜態網頁可以在虛擬主機中正常啟動. 老師的blogger: https://2019wcm.blogspot.com/ 最後我完成的虛擬主機連結:192.168.56.102 我的操作影片1: https://youtu.be/Aj-_ISvdLGI 我的操作影片2: https://youtu.be/SVL-Hk0yNew', 'tags': '', 'url': '6.李承澤 40723210.html'}, {'title': 'Javascript', 'text': '設法利用\xa0 HTML5 CSS 與 Javascript , 納入與機械設計相關的靜態網頁內容 \n \n', 'tags': '', 'url': 'Javascript.html'}, {'title': '國旗', 'text': '\n', 'tags': '', 'url': '國旗.html'}, {'title': '期中報告', 'text': '張詠全 40723125\xa0\xa0 影片 \n 廖豪樹 40723144\xa0 影片 \n 李其叡 40723111\xa0 影片 \n 李承澤 40723210\xa0 影片 \n 王頊鑌 40723108\xa0 影片 \n 許鐸鐙40426227\xa0 影片 \n 俆敬倫40723124\xa0 影片', 'tags': '', 'url': '期中報告.html'}]};